import React from "react";


const Filtros = ({genres, handleCheckbox, checked}) => {

    return(
        <div>
            <div>
                <input type='text'/>
                <button>Buscar</button>
            </div>
            <div>
                <span>genres</span>
                <div>
                {
                    genres && genres.map( g => {
                        return (
                            <div key={`gg${g.id}`} className="item-genres">
                                <input 
                                    type="checkbox"
                                    name="genres"
                                    id={g.id}
                                    value={g.id}
                                    onChange={ (e) => handleCheckbox(e) }
                                    checked={checked && checked[g.id]}
                                    />
                                <label htmlFor={g.id}>
                                    {g.name}
                                </label>
                            </div>
                            )
                    })
                }
                </div>
            </div>
        </div>
    );
}

export default Filtros;
